// src/components/UserDashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
// Add these icons if you're using heroicons
import { BusFront, MapPin } from 'lucide-react';

const UserDashboard = () => {
  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header Section */}
      <div className="bg-white shadow">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-6">
          <h1 className="text-3xl font-bold text-gray-900">Dashboard</h1>
        </div>
      </div>

      {/* Main Content */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          {/* Bus Card */}
          <Link 
            to="/view-buses"
            className="block p-6 bg-white rounded-lg shadow-sm hover:shadow-md transition-shadow duration-300"
          >
            <div className="flex items-center">
              <div className="flex-shrink-0 p-3 bg-blue-100 rounded-lg">
                <BusFront className="h-6 w-6 text-blue-600" />
              </div>
              <div className="ml-4">
                <h2 className="text-xl font-semibold text-gray-900">View Buses</h2>
                <p className="mt-1 text-gray-600">Check available buses and schedules</p>
              </div>
            </div>
          </Link>

          {/* Routes Card */}
          <Link 
            to="/view-routes"
            className="block p-6 bg-white rounded-lg shadow-sm hover:shadow-md transition-shadow duration-300"
          >
            <div className="flex items-center">
              <div className="flex-shrink-0 p-3 bg-green-100 rounded-lg">
                <MapPin className="h-6 w-6 text-green-600" />
              </div>
              <div className="ml-4">
                <h2 className="text-xl font-semibold text-gray-900">View Routes</h2>
                <p className="mt-1 text-gray-600">Explore bus routes and destinations</p>
              </div>
            </div>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default UserDashboard;
